import React from "react";
import "../styles/Header.css";

// By importing the Header.css file, it is added to the DOM whenever this component loads
const style = {
  color: "white",
  backgroundColor: "red",
  paddingBottom: "10px"
};

function Header() {
  return (
    <header style={style} className="header">
      <h1>Welcome</h1>
    </header>
  );
}

export default Header;
